import React from "react";
import AboutMe from "./attributes/AboutMe";
import Experience from "./attributes/Experience";
import Projects from "./attributes/Projects";
import Skills from "./attributes/Skills";
import Education from "./attributes/Education";
import Contact from "./attributes/Contact";

class Topper extends React.Component {
  constructor(props) {
    super(props);
    this.renderable = this.renderable.bind(this);
    this.assignRender = this.assignRender.bind(this);
    this.contactBubbles = this.contactBubbles.bind(this);
    this.state = {
      active: 1
    };
  }

  assignRender(n) {
    this.setState({
      active: n
    });
  }

  renderable() {
    switch (this.state.active) {
      case 1: {
        return <AboutMe />;
      }
      case 2: {
        return <Experience />;
      }
      case 3: {
        return <Projects />;
      }
      case 4: {
        return <Skills />;
      }
      case 5: {
        return <Education />;
      }
      case 6: {
        return <Contact />;
      }
      default: {
        return <AboutMe />;
      }
    }
  }

  contactBubbles() {
    return (
      <div className="contact-topper-container">
        <div id="gmail-bubble" className="contact-topper"></div>
        <div id="linkedin-bubble" className="contact-topper"></div>
        <div id="angel-bubble" className="contact-topper"></div>
        <div id="git-bubble" className="contact-topper"></div>
      </div>
    );
  }

  render() {
    return (
      <div id="main">
        <div id="topper">
          <div className="banner-photo" />
          <div className="floatbox">
            <span>Campbell Oleson</span>
            <p>Full-stack software engineer</p>
          </div>
          <div className="profile-photo" />
          {this.contactBubbles()}
          <div className="top-nav">
            <div
              className="top-nav-button"
              onClick={() => this.assignRender(1)}
            >
              About me
            </div>
            <div
              className="top-nav-button"
              onClick={() => this.assignRender(2)}
            >
              Experience
            </div>
            <div
              className="top-nav-button"
              onClick={() => this.assignRender(3)}
            >
              Projects
            </div>
            <div
              className="top-nav-button"
              onClick={() => this.assignRender(4)}
            >
              Skills
            </div>
            <div
              className="top-nav-button"
              onClick={() => this.assignRender(5)}
            >
              Education
            </div>
            <div
              className="top-nav-button"
              onClick={() => this.assignRender(6)}
            >
              Contact
            </div>
          </div>
        </div>
        <div id="mount">{this.renderable()}</div>
      </div>
    );
  }
}

export default Topper;
